import React, { Fragment } from 'react';
import Header from './components/Header';
import Banner from './components/Banner';
import Portafolio from './components/Portafolio';
import About from './components/About';

import './App.css';

function App() {
  return (
    <Fragment>
      <Header />
      <Banner />
      <Portafolio />
      <About />
    </Fragment>
  );
}

export default App;
